import React, { useState } from "react";
import { styled } from "reakit";
import { Colors, Size, Fonts, style } from "../../assets/common/Styles";
import { Redirect, Route, Switch, useHistory } from "react-router-dom";
import MainPage from "../Root/MainPage";
import Home from "../Home";

import { Field, reduxForm } from "redux-form";
import { isValid as isFormValid, submit as submitForm } from "redux-form";
import { connect } from "react-redux";
import Input from "../../components/Input";
import Button from "../../components/Button";

const Label = styled.label`
  padding: 0.2rem;
  color: ${Colors.DustGray};
  font-weight: bold;
  font-size: ${Fonts.FontSize.small};
`;
const LoginForm = (props) => {
  const { submitForm } = props;
  const history = useHistory();

  const routeChange = () => {
    submitForm("mainForm");
    history.push(`/`);
  };

  return (
    <div>
      <Field
        key={"name"}
        name="user_type_id"
        component={Input}
        type="input"
        value={"ddd"}
      />
      <Button text={"Klikni"} onClick={() => history.push(`/`)} />
    </div>
  );
};

const mapStateToProps = (state) => {
  return {
    posts: state.posts,
  };
};
const mapDispatchToProps = {
  submitForm,
};

export default connect(mapStateToProps, mapDispatchToProps)(LoginForm);
